<style>
    body {
        height: 1400vh;
        margin: 0;
        overflow-x: hidden;
        background-color: #4C4B4B;
        font-family: 'Quicksand', sans-serif;
        box-sizing: border-box;
    }

    .dialog-window {
        background-color: #FBCC45;
        z-index: 1000;
        position: relative;
        text-align: center;
        height: 399px;
    }

    .dialog-window--mobile {
        display: none;
        background-color: #FBCC45;
        z-index: 1000;
        text-align: center;
        position: relative;
        width: 100%;
    }

    @media screen and (max-width: 600px) {
        .dialog-window {
            display: none;
        }

        .dialog-window--mobile {
            display: block;
        }

        .section-title {
            width: 100vw;
            height: auto;
            display: flex; 
            align-items: start;
        }
    }
    
    .dialog-1 .dialog-window {
        padding-top: 15px;
    }

    .dialog-1 .dialog-window::after {
        display: block;
        content: '';
        top: 50.5%;
        position: absolute;
        height: 2px;
        background-color: #000;
        width: 100%;
    }

    .dialog-5 .dialog-window::after {
        display: block;
        content: '';
        top: 49%;
        position: absolute;
        height: 2px;
        background-color: #000;
        width: 100%;
    }


    .section-title {
        z-index: 1000;
        position: absolute;
        top: 0;
        left: 50%;
        transform: translateX(-50%) ;
        text-align: center;
    }

    

    .hidden {
        display: none;
    }

    
    .yellow-text {
        color: #FFEA2C;
    }

    .logo {
        position: fixed;
        top: 20px;
        right: 20px;
        z-index: 1;
    }

    #button-link, 
    #vk, 
    #telegram {
        cursor: pointer;
    }

    #lights {
        animation: lights 2s linear infinite alternate-reverse;
        transform-origin: 50% 50%; 
    }

    @keyframes lights {   
        from {     
            transform: rotate(0deg) translateY(-20%);   
        }   
        to {
            transform: rotate(10deg) translateY(-20%);   
        }
    }

    @font-face {
        font-family: "Zing";
        src: url('/zing-font.ttf') format("opentype");
    }
</style>
